• Commonly referred to as "gun taps"

For tapping of "through holes" or deep blind holes where a shoulder exists for chips to collect.

Spiral point taps eject chips forward. Necked design for deeper, more trouble free tapping.&nbsp;

Freer coolant flow to cutting edges. Heavier core for less breakage.&nbsp;

Three flutes for 50% less tooth load.&nbsp;

Promotes faster tapping and extended tool life.

• Left Hand

• Spiral Flute&nbsp;

For the removal of broken screws, studs, bolts or pipe fitting.&nbsp;

The left hand rotation of the tapered flutes forces out almost any right hand threaded part. Penetrating oil can be helpful in removing rusty or corroded parts.

Pilot Pins for Carbide Tipped Annular Cutters.
&nbsp;
CT150-Pin, CT200-Pin fits 9/16" and 5/8" diameter carbide tipped annular cutters (i.e., CT150-9/16" and CT150-5/8").&nbsp;
CT150P fits with CT150 annular cutters. &nbsp;CT200P fits with CT200 annular cutters.
CT300P fits with CT300 annular cutters. &nbsp;CT400P fits with CT400 annular cutters.

Pilot Pins for HSS Annular Cutters.
&nbsp;
1/4" diameter pilot pins for use with high speed steel RotoBrute annular cutters (XL100, XL200, XL300). &nbsp;XL100P-7/16" and XL200P-7/16" for use with 7/16" diameter high speed annular cutters. &nbsp;XL100P is used with XL100 annular cutters. &nbsp;XL200P is used with XL200 annular cutters. &nbsp;XP300P is used with XL300 annular cutters.

